const Registration = props => {
    // let { registration } = useParams();
    return (
        <Box sx={{
            m: 1,
        }}>
            <Card variant="outlined" sx={{ maxWidth: 550, maxHeight: 5000, borderRadius: 5, borderColor: 'primary.main', paddingTop: 1, marginTop: 3, margin: "center" }} margin="10px">
                <CardActions>
                </CardActions>
            </Card>
        </Box>
    );

};
export default Registration;
